import React from "react";
import { Bar } from "react-chartjs-2"


export default function Array() {
    const array: number[] = [9, 7, 2, 1, 4, 8, 0, 3, 6, 5];

    const chartData = {
        data: array,
        title: {
            display: true,
            text: "something"
        }
    }

    return (
        <div>
            <Bar data={chartData} options={{title: chartData.title}}/>
        </div>
    );
}
